import React, {
    useState
} from 'react';
import {
    Typography
} from '@material-ui/core';
import {
    Button
} from '@material-ui/core';
import {
    Grid
} from '@material-ui/core';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import Skill from './Skill';

const Skills = () => {
    return ( <
        Grid container direction = "row"
        justify = "flex-start"
        alignItems = "center"
        style = {
            {
                marginLeft: '30px'
            }
        } >

        <
        Grid item xs = {
            12
        } >
        <
        Typography display = "block"
        justifyContent = "center"
        align = "center"
        variant = "h4"
        style = {
            {
                opacity: '100%',
                fontWeight: 'bold',
                fontSize: '40px',
                marginBottom: '0',
                color: 'white'
            }
        } >
        Skills <
        /Typography> <
        /Grid>

        <
        Skill skillName = 'Python' / >
        <
        Skill skillName = 'Javascript' / >
        <
        Skill skillName = 'React' / >
        <
        Skill skillName = 'Material UI' / >
        <
        Skill skillName = 'LateX' / >
        <
        Skill skillName = 'Mathematica' / >
        <
        Skill skillName = 'SQL' / >
        <
        Skill skillName = 'MS Office' / >

        <
        /Grid>
    )
}

export default Skills;
